import React from 'react';

const SpaceManager = (props) => {
  return (
    <div className="row">
      <div className="container">
        <p className="licPlate">{props.dummyData.licPlate}</p>
        <p className="name">{props.dummyData.name}</p>
        <p className="time">{props.dummyData.time}</p>
      </div>
    </div>
  )
}

export default SpaceManager
